import React, { Component } from 'react';
import {BrowserRouter as Router, Link, Route} from "react-router-dom";
import logo from './../assets/img/ku-anim.gif';
import tag from './../assets/img/mstrkuku-alt.PNG';
import '../App.sass';

import Nav from './Nav';
import Info from './Info';
import Gallery from './Gallery';
import Request from './Request';
import Comics from './Comics';
import Footer from './Footer';



class App extends Component {
  render() {
    return (
      <div className="App">
        <section className="App-global">
          <Router>
            <Nav/>
            <div className="Nav">
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/about">About</Link>
                </li>
                <li>
                  <Link to="/topics">Topics</Link>
                </li>
              </ul>
              <hr/>
            </div>
            <Route exact path="/" component={Info}/>
            <Route path="/about" component={Gallery}/>
            <Route path="/topics" component={Request}/>
          </Router>
          <img src={tag} className="App-tag" alt="logo" />
          <img src={logo} className="App-logo" alt="logo" />
          <code> mstrkuku.com </code>
          <p>Coming Soon...</p>
          <a className="App-link" href="https://reactjs.org" target="_blank" rel="noopener noreferrer">Learn React</a>
        </section>
      </div>
    );
  }
}

export default App;
